import styles from "./Crew.module.css";
import crew from "./CrewMembers"

const Crew = () => {
  const douglasPic = [douglasPNG,douglasWEBP];
  const markPic = [markPNG,markWEBP];
  const victorPic = [victorPNG,victorWEBP];
  const ansariPic = [ansariPNG,ansariWEBP];


  const [pic,setPic] =useState(douglasPic);
  return (
    <div className={styles.page}>
      <div className={styles.content}>
        <h5 className={styles.meetCrew}>
          MEET YOUR CREW
        </h5>
        <div className={styles.crewMemberPic}>
          <img src={pic[1]} alt="" srcset={`${pic[0]} 3x`} />
          <span className={styles.crewMemberPicUnderline}>&nbsp;</span>
        </div>
      </div>
    </div>
  )
}

export default Crew;
